import { Component, OnInit } from '@angular/core';
import { IonRouterOutlet } from '@ionic/angular/standalone';
import { IonicModule } from '@ionic/angular';
import { RouterLink } from '@angular/router';
import { AutoService } from './auto.service'; // AsegÃºrate de que la ruta es correcta

@Component({
  selector: 'app-root',
  templateUrl: 'app.component.html',
  standalone: true,
  imports: [IonRouterOutlet, IonicModule, RouterLink],
})
export class AppComponent implements OnInit {
  products: any[] = [];  // Array para almacenar los productos

  constructor(private autoService: AutoService) { }

  ngOnInit() {
    // Obtener los autos desde la API cuando se inicialice el componente
    this.autoService.getAutos().subscribe(
      (data) => {
        this.products = data;  // Asignar los datos a la variable products
      },
      (error) => {
        console.error('Error fetching data', error);  // Manejar errores
      }
    );
  }
}
